INSERT INTO `drupal_locales_source` VALUES (20695,'/pl/filter/tips','default','Special image formatting can be done via [[Image:name|alignment|size|caption]] where any of additional information is optional. <em>alignment</em> is one of <em>left</em>, <em>center</em> or <em>right</em>. Size is in the format <em>80px</em> or <em>80x70px</em>. The caption is arbitrary text. See the <a href=\"@url\">wikipedia help</a> for the full syntax, but be aware that frames and description text is not supported.','6.16');
