INSERT INTO `drupal_locales_source` VALUES (20521,'/pl/admin/content/simplenews/types/list','default','Both anonymous and authenticated users can <strong>opt-in and opt-out</strong> to a newsletter. A confirmation message is sent to anonymous users at subscription and unsubscription. Users can (un)subscribe using a form and a block. A <strong>subscription block</strong> is available for each newsletter offering a subscription form, a link to recent newsletters and RSS feed. Email addresses can also be imported and exported via the subscription administration pages.','6.16');
INSERT INTO `drupal_locales_source` VALUES (20520,'/pl/admin/content/simplenews/types/list','default','Simplenews adds elements to the newsletter node add/edit form to manage newsletter format and sending of the newsletter issue. A newsletter issue can be sent for test before sending officially.','6.16');
INSERT INTO `drupal_locales_source` VALUES (20519,'/pl/admin/content/simplenews/types/list','default','Simplenews uses nodes for <strong>newsletter issues</strong>. Newsletter issues are grouped by a <strong>newsletter taxonomy term</strong>. Node type and vocabulary are selectable. A newsletter is send to all email addresses which are subscribed to the newsletter. Newsletter issues can be sent only once. Large mailings should be sent by cron to balance the mailserver load.','6.16');
