INSERT INTO `drupal_locales_source` VALUES (20518,'/pl/admin/content/simplenews/types/list','default','Simplenews publishes and sends newsletters to lists of subscribers. Both anonymous and authenticated users can opt-in to different mailing lists.','6.16');
