INSERT INTO `drupal_locales_source` VALUES (17328,' modules/user/user.module:1901','default','The user module allows users to register, login, and log out. Users benefit from being able to sign on because it associates content they create with their account and allows various permissions to be set for their roles. The user module supports user roles which establish fine grained permissions allowing each role to do only what the administrator wants them to. Each user is assigned to one or more roles. By default there are two roles <em>anonymous</em> - a user who has not logged in, and <em>authenticated</em> a user who has signed up and who has been authorized.','6.19');
INSERT INTO `drupal_locales_source` VALUES (17329,' modules/user/user.module:1902','default','Users can use their own name or handle and can specify personal configuration settings through their individual <em>My account</em> page. Users must authenticate by supplying a local username and password or through their OpenID, an optional and secure method for logging into many websites with a single username and password. In some configurations, users may authenticate using a username and password from another Drupal site, or through some other site-specific mechanism.','6.19');
INSERT INTO `drupal_locales_source` VALUES (17330,' modules/user/user.module:1903','default','A visitor accessing your website is assigned a unique ID, or session ID, which is stored in a cookie. The cookie does not contain personal information, but acts as a key to retrieve information from your site. Users should have cookies enabled in their web browser when using your site.','6.19');
INSERT INTO `drupal_locales_source` VALUES (17331,' modules/user/user.module:1904','default','For more information, see the online handbook entry for <a href=\"@user\">User module</a>.','6.19');
INSERT INTO `drupal_locales_source` VALUES (17332,' modules/user/user.module:1907','default','Drupal allows users to register, login, log out, maintain user profiles, etc. Users of the site may not use their own names to post content until they have signed up for a user account.','6.19');
INSERT INTO `drupal_locales_source` VALUES (17333,' modules/user/user.module:1910','default','This web page allows administrators to register new users. Users\' e-mail addresses and usernames must be unique.','none');
INSERT INTO `drupal_locales_source` VALUES (17334,' modules/user/user.module:1912','default','Set up username and e-mail address access rules for new <em>and</em> existing accounts (currently logged in accounts will not be logged out). If a username or e-mail address for an account matches any deny rule, but not an allow rule, then the account will not be allowed to be created or to log in. A host rule is effective for every page view, not just registrations.','none');
INSERT INTO `drupal_locales_source` VALUES (17335,' modules/user/user.module:1914','default','Permissions let you control what users can do on your site. Each user role (defined on the <a href=\"@role\">user roles page</a>) has its own set of permissions. For example, you could give users classified as \"Administrators\" permission to \"administer nodes\" but deny this power to ordinary, \"authenticated\" users. You can use permissions to reveal new features to privileged users (those with subscriptions, for example). Permissions also allow trusted users to share the administrative burden of running a busy site.','6.19');
