INSERT INTO `drupal_locales_source` VALUES (16968,' modules/translation/translation.module:43','default','The <a href=\"@content-node\">Content management administration page</a> displays the language of each post, and also allows filtering by language or translation status.','none');
INSERT INTO `drupal_locales_source` VALUES (16967,' modules/translation/translation.module:42','default','Update translations as needed, so that they accurately reflect changes in the content of the original post. The translation status flag provides a simple method for tracking outdated translations. After editing a post, for example, select the <em>Flag translations as outdated</em> check box to mark all of its translations as outdated and in need of revision. Individual translations may be marked for revision by selecting the <em>This translation needs to be updated</em> check box on the translation editing form.','none');
INSERT INTO `drupal_locales_source` VALUES (16966,' modules/translation/translation.module:41','default','Provide new or edit current translations for existing posts via the <em>Translation</em> tab. Only visible while viewing a post as a user with the <em>translate content</em> permission, this tab allows translations to be added or edited using a specialized editing form that also displays the content being translated.','none');
INSERT INTO `drupal_locales_source` VALUES (16965,' modules/translation/translation.module:40','default','Use the <em>Language</em> drop down to select the appropriate language when creating or editing posts.','none');
