INSERT INTO `drupal_locales_source` VALUES (16963,' modules/translation/translation.module:38','default','Determine which <a href=\"@content-types\">content types</a> should support translation features. To enable translation support for a content type, edit the type and at the <em>Multilingual support</em> drop down, select <em>Enabled, with translation</em>. (<em>Multilingual support</em> is located within <em>Workflow settings</em>.) Be sure to save each content type after enabling multilingual support.','none');
