INSERT INTO `drupal_locales_source` VALUES (16948,' modules/tracker/tracker.module:16','default','The <em>Recent posts</em> page is available via a link in the navigation menu block and displays new and recently-updated content (including the content type, the title, the author\'s name, number of comments, and time of last update) in reverse chronological order. Posts are marked updated when changes occur in the text, or when new comments are added. To use the tracker module to follow a specific user\'s contributions, select the <em>Track</em> tab from the user\'s profile page.','none');
