INSERT INTO `drupal_locales_source` VALUES (16944,' modules/throttle/throttle.module:126','default','The throttle module provides a congestion control mechanism that automatically adjusts to a surge in incoming traffic. If your site is referenced by a popular website, or experiences a \"Denial of Service\" (DoS) attack, your webserver might become overwhelmed. The throttle mechanism is utilized by modules to temporarily disable CPU-intensive functionality, increasing performance.','none');
