INSERT INTO `drupal_locales_source` VALUES (16923,' modules/throttle/throttle.admin.inc:40','default','The auto-throttle probability limiter is an efficiency mechanism to statistically reduce the overhead of the auto-throttle. The limiter is expressed as a percentage of page views, so for example if set to the default of 10% we only perform the extra database queries to update the throttle status 1 out of every 10 page views. The busier your site, the lower you should set the limiter value.','none');
INSERT INTO `drupal_locales_source` VALUES (16921,' modules/throttle/throttle.admin.inc:33','default','The congestion control throttle can be automatically enabled when the number of authenticated users currently visiting your site exceeds the specified threshold. For example, to start the throttle when your site has 50 registered users online at once, enter \'50\' in this field. Leave this value blank or set to \"0\" if you do not wish to auto-throttle on authenticated users. You can inspect the current number of authenticated users using the \"Who\'s online\" block.','none');
INSERT INTO `drupal_locales_source` VALUES (16920,' modules/throttle/throttle.admin.inc:29','default','Auto-throttle on authenticated users','none');
INSERT INTO `drupal_locales_source` VALUES (16919,' modules/throttle/throttle.admin.inc:25','default','The congestion control throttle can be automatically enabled when the number of anonymous users currently visiting your site exceeds the specified threshold. For example, to start the throttle when your site has 250 anonymous users online at once, enter \'250\' in this field. Leave this value blank or set to \"0\" if you do not wish to auto-throttle on anonymous users. You can inspect the current number of anonymous users using the \"Who\'s online\" block.','none');
