INSERT INTO `drupal_locales_source` VALUES (16914,' modules/taxonomy/taxonomy.module:1293','default','Define how your vocabulary will be presented to administrators and users, and which content types to categorize with it. Tags allows users to create terms when submitting posts by typing a comma separated list. Otherwise terms are chosen from a select list and can only be created by users with the \"administer taxonomy\" permission.','none');
INSERT INTO `drupal_locales_source` VALUES (16913,' modules/taxonomy/taxonomy.module:1290','default','%capital_name is a multiple hierarchy vocabulary. To change the name or description of a term, click the <em>edit</em> link next to the term. Drag and drop of multiple hierarchies is not supported, but you can re-enable drag and drop support by editing each term to include only a single parent.','none');
INSERT INTO `drupal_locales_source` VALUES (16912,' modules/taxonomy/taxonomy.module:1288','default','%capital_name is a single hierarchy vocabulary. You may organize the terms in the %name vocabulary by using the handles on the left side of the table. To change the name or description of a term, click the <em>edit</em> link next to the term.','none');
INSERT INTO `drupal_locales_source` VALUES (16911,' modules/taxonomy/taxonomy.module:1286','default','%capital_name is a flat vocabulary. You may organize the terms in the %name vocabulary by using the handles on the left side of the table. To change the name or description of a term, click the <em>edit</em> link next to the term.','none');
INSERT INTO `drupal_locales_source` VALUES (16910,' modules/taxonomy/taxonomy.module:1282','default','%capital_name is a free-tagging vocabulary. To change the name or description of a term, click the <em>edit</em> link next to the term.','none');
INSERT INTO `drupal_locales_source` VALUES (16909,' modules/taxonomy/taxonomy.module:1277','default','Use the list below to configure and review the vocabularies defined on your site, or to list and manage the terms (tags) they contain. A vocabulary may (optionally) be tied to specific content types as shown in the <em>Type</em> column and, if so, will be displayed when creating or editing posts of that type. Multiple vocabularies tied to the same content type will be displayed in the order shown below. To change the order of a vocabulary, grab a drag-and-drop handle under the <em>Name</em> column and drag it to a new location in the list. (Grab a handle by clicking and holding the mouse while hovering over a handle icon.) Remember that your changes will not be saved until you click the <em>Save</em> button at the bottom of the page.','none');
INSERT INTO `drupal_locales_source` VALUES (16908,' modules/taxonomy/taxonomy.module:1276','default','The taxonomy module allows you to categorize your content using both tags and administrator defined terms. It is a flexible tool for classifying content with many advanced features. To begin, create a \'Vocabulary\' to hold one set of terms or tags. You can create one free-tagging vocabulary for everything, or separate controlled vocabularies to define the various properties of your content, for example \'Countries\' or \'Colors\'.','none');
INSERT INTO `drupal_locales_source` VALUES (16907,' modules/taxonomy/taxonomy.module:1273','default','For more information, see the online handbook entry for <a href=\"@taxonomy\">Taxonomy module</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (16906,' modules/taxonomy/taxonomy.module:1272','default','The taxonomy module supports the use of both synonyms and related terms, but does not directly use this functionality. However, optional contributed or custom modules may make full use of these advanced features.','none');
INSERT INTO `drupal_locales_source` VALUES (16905,' modules/taxonomy/taxonomy.module:1271','default','Terms can also be organized in parent/child relationships from the admin interface. An example would be a vocabulary grouping countries under their parent geo-political regions. The taxonomy module also enables advanced implementations of hierarchy, for example placing Turkey in both the \'Middle East\' and \'Europe\'.','none');
INSERT INTO `drupal_locales_source` VALUES (16904,' modules/taxonomy/taxonomy.module:1270','default','Each taxonomy term (often called a \'category\' or \'tag\' in other systems) automatically provides lists of posts and a corresponding RSS feed. These taxonomy/term URLs can be manipulated to generate AND and OR lists of posts classified with terms. In our recipe site example, it then becomes easy to create pages displaying \'Main courses\', \'30 minute recipes\', or \'30 minute main courses and appetizers\' by using terms on their own or in combination with others. There are a significant number of contributed modules which you to alter and extend the behavior of the core module for both display and organization of terms.','none');
INSERT INTO `drupal_locales_source` VALUES (16903,' modules/taxonomy/taxonomy.module:1269','default','Preparation Time: <em>0-30mins, 30-60mins, 1-2 hrs, 2hrs+</em>','none');
INSERT INTO `drupal_locales_source` VALUES (16902,' modules/taxonomy/taxonomy.module:1268','default','Type of Meal: <em>Appetizer, Main Course, Salad, Dessert</em>','none');
INSERT INTO `drupal_locales_source` VALUES (16901,' modules/taxonomy/taxonomy.module:1267','default','For example, when creating a recipe site, you might want to classify posts by both the type of meal and preparation time. A vocabulary for each allows you to categorize using each criteria independently instead of creating a tag for every possible combination.','none');
INSERT INTO `drupal_locales_source` VALUES (16900,' modules/taxonomy/taxonomy.module:1266','default','The taxonomy module allows you to categorize content using various systems of classification. Free-tagging vocabularies are created by users on the fly when they submit posts (as commonly found in blogs and social bookmarking applications). Controlled vocabularies allow for administrator-defined short lists of terms as well as complex hierarchies with multiple relationships between different terms. These methods can be applied to different content types and combined together to create a powerful and flexible method of classifying and presenting your content.','none');
