INSERT INTO `drupal_locales_source` VALUES (16742,' modules/system/system.module:95','default','There are two types of actions: simple and advanced. Simple actions do not require any additional configuration, and are listed here automatically. Advanced actions can do more than simple actions; for example, send an e-mail to a specified address, or check for certain words within a piece of content. These actions need to be created and configured first before they may be used. To create an advanced action, select the action from the drop-down below and click the <em>Create</em> button.','none');
INSERT INTO `drupal_locales_source` VALUES (16741,' modules/system/system.module:94','default','Actions are individual tasks that the system can do, such as unpublishing a piece of content or banning a user. Modules, such as the trigger module, can fire these actions when certain system events happen; for example, when a new post is added or when a user logs in. Modules may also provide additional actions.','none');
INSERT INTO `drupal_locales_source` VALUES (16740,' modules/system/system.module:89','default','The <em>Powered by Drupal</em> block is an optional link to the home page of the Drupal project. While there is absolutely no requirement that sites feature this link, it may be used to show support for Drupal.','none');
INSERT INTO `drupal_locales_source` VALUES (16739,' modules/system/system.module:86','default','The uninstall process removes all data related to a module. To uninstall a module, you must first disable it. Not all modules support this feature.','none');
