INSERT INTO `drupal_locales_source` VALUES (16736,' modules/system/system.module:81','default','It is important that <a href=\"@update-php\">update.php</a> is run every time a module is updated to a newer version.','6.16');
INSERT INTO `drupal_locales_source` VALUES (16737,' modules/system/system.module:82','default','You can find all administration tasks belonging to a particular module on the <a href=\"@by-module\">administration by module page</a>.','6.16');
INSERT INTO `drupal_locales_source` VALUES (16731,' modules/system/system.module:67','default','To change the appearance of your site, a number of <a href=\"@themes\">contributed themes</a> are available.','none');
INSERT INTO `drupal_locales_source` VALUES (16732,' modules/system/system.module:72','default','These options control the display settings for the <code>%template</code> theme. When your site is displayed using this theme, these settings will be used. By clicking \"Reset to defaults,\" you can choose to use the <a href=\"@global\">global settings</a> for this theme.','none');
INSERT INTO `drupal_locales_source` VALUES (16733,' modules/system/system.module:74','default','These options control the default display settings for your entire site, across all themes. Unless they have been overridden by a specific theme, these settings will be used.','none');
INSERT INTO `drupal_locales_source` VALUES (16734,' modules/system/system.module:76','default','Modules are plugins that extend Drupal\'s core functionality. Enable modules by selecting the <em>Enabled</em> checkboxes below and clicking the <em>Save configuration</em> button. Once a module is enabled, new <a href=\"@permissions\">permissions</a> may be available. To reduce server load, modules with their <em>Throttle</em> checkbox selected are temporarily disabled when your site becomes extremely busy. (Note that the <em>Throttle</em> checkbox is only available if the Throttle module is enabled.)','6.16');
INSERT INTO `drupal_locales_source` VALUES (16729,' modules/system/system.module:64','default','This page shows you all available administration tasks for each module.','none');
INSERT INTO `drupal_locales_source` VALUES (16730,' modules/system/system.module:66','default','Select which themes are available to your users and specify the default theme. To configure site-wide display settings, click the \"configure\" task above. Alternatively, to override these settings in a specific theme, click the \"configure\" link for that theme. Note that different themes may have different regions available for displaying content; for consistency in presentation, you may wish to enable only one theme.','none');
INSERT INTO `drupal_locales_source` VALUES (16728,' modules/system/system.module:62','default','Welcome to the administration section. Here you may control how your site functions.','6.19');
INSERT INTO `drupal_locales_source` VALUES (16727,' modules/system/system.module:59','default','For more information, see the online handbook entry for <a href=\"@system\">System module</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (16725,' modules/system/system.module:57','default','a set of routine administrative operations that rely on a correctly-configured <a href=\"@cron\">cron maintenance task</a> to run automatically. A number of other modules, including the feed aggregator, ping module and search also rely on <a href=\"@cron\">cron maintenance tasks</a>. For more information, see the online handbook entry for <a href=\"@handbook\">configuring cron jobs</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (16726,' modules/system/system.module:58','default','basic configuration options for your site, including <a href=\"@date-settings\">date and time settings</a>, <a href=\"@file-system\">file system settings</a>, <a href=\"@clean-url\">clean URL support</a>, <a href=\"@site-info\">site name and other information</a>, and a <a href=\"@site-maintenance\">site maintenance</a> function for taking your site temporarily off-line.','none');
INSERT INTO `drupal_locales_source` VALUES (16724,' modules/system/system.module:56','default','a robust <a href=\"@cache-settings\">caching system</a> that allows the efficient re-use of previously-constructed web pages and web page components. Drupal stores the pages requested by anonymous users in a compressed format; depending on your site configuration and the amount of your web traffic tied to anonymous visitors, Drupal\'s caching system may significantly increase the speed of your site.','none');
INSERT INTO `drupal_locales_source` VALUES (16723,' modules/system/system.module:55','default','support for enabling and disabling <a href=\"@themes\">themes</a>, which determine the design and presentation of your site. Drupal comes packaged with several core themes and additional contributed themes are available at the <a href=\"@drupal-themes\">Drupal.org theme page</a>.','none');
