INSERT INTO `drupal_locales_source` VALUES (16722,' modules/system/system.module:54','default','support for enabling and disabling <a href=\"@modules\">modules</a>. Drupal comes packaged with a number of core modules; each module provides a discrete set of features and may be enabled depending on the needs of your site. A wide array of additional modules contributed by members of the Drupal community are available for download at the <a href=\"@drupal-modules\">Drupal.org module page</a>.','none');
