INSERT INTO `drupal_locales_source` VALUES (16518,' modules/syslog/syslog.module:22','default','The syslog module enables Drupal to send messages to the operating system\'s logging facility.','none');
INSERT INTO `drupal_locales_source` VALUES (16519,' modules/syslog/syslog.module:23','default','Syslog is an operating system administrative logging tool, and provides valuable information for use in system management and security auditing. Most suited to medium and large sites, syslog provides filtering tools that allow messages to be routed by type and severity. On UNIX/Linux systems, the file /etc/syslog.conf defines this routing configuration; on Microsoft Windows, all messages are sent to the Event Log. For more information on syslog facilities, severity levels, and how to set up a syslog.conf file, see <a href=\"@syslog_conf\">UNIX/Linux syslog.conf</a> and PHP\'s <a href=\"@php_openlog\">openlog</a> and <a href=\"@php_syslog\">syslog</a> functions.','none');
INSERT INTO `drupal_locales_source` VALUES (16520,' modules/syslog/syslog.module:24','default','For more information, see the online handbook entry for <a href=\"@syslog\">Syslog module</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (16521,' modules/syslog/syslog.module:32','default','Settings for syslog logging. Syslog is an operating system administrative logging tool used in systems management and security auditing. Most suited to medium and large sites, syslog provides filtering tools that allow messages to be routed by type and severity.','none');
INSERT INTO `drupal_locales_source` VALUES (16522,' modules/syslog/syslog.module:43','default','Send events to this syslog facility','none');
INSERT INTO `drupal_locales_source` VALUES (16523,' modules/syslog/syslog.module:46','default','Select the syslog facility code under which Drupal\'s messages should be sent. On UNIX/Linux systems, Drupal can flag its messages with the code LOG_LOCAL0 through LOG_LOCAL7; for Microsoft Windows, all messages are flagged with the code LOG_USER. Depending on the system configuration, syslog and other logging tools use this code to identify or filter Drupal messages from within the entire system log. For more information on syslog, see <a href=\"@syslog_help\">Syslog help</a>.','none');
