INSERT INTO `drupal_locales_source` VALUES (16472,' modules/statistics/statistics.module:15','default','The statistics module keeps track of numerous site usage statistics, including the number of times, and from where, each of your posts is viewed. These statistics are useful in determining how users are interacting with each other and with your site, and are required for the display of some Drupal blocks.','none');
INSERT INTO `drupal_locales_source` VALUES (16473,' modules/statistics/statistics.module:16','default','The statistics module provides:','none');
INSERT INTO `drupal_locales_source` VALUES (16474,' modules/statistics/statistics.module:17','default','a counter for each post on your site that increments each time the post is viewed. (Enable <em>Count content views</em> on the <a href=\"@accesslog\">access log settings page</a>, and determine if the post access counters should be visible to any user roles on the <a href=\"@permissions\">permissions page</a>.)','none');
INSERT INTO `drupal_locales_source` VALUES (16475,' modules/statistics/statistics.module:18','default','a <a href=\"@recent-hits\">recent hits</a> log that displays information about the latest activity on your site, including the URL and title of the page accessed, the user name (if available) and IP address of the accessing party.','none');
INSERT INTO `drupal_locales_source` VALUES (16476,' modules/statistics/statistics.module:19','default','a <a href=\"@top-referrers\">top referrers</a> log that displays the referring parties for your site visits (where your visitors came from).','none');
INSERT INTO `drupal_locales_source` VALUES (16477,' modules/statistics/statistics.module:20','default','a <a href=\"@top-pages\">top pages</a> log that displays site content in descending order by number of views.','none');
INSERT INTO `drupal_locales_source` VALUES (16478,' modules/statistics/statistics.module:21','default','a <a href=\"@top-visitors\">top visitors</a> log that displays the most active users on your site.','none');
INSERT INTO `drupal_locales_source` VALUES (16479,' modules/statistics/statistics.module:22','default','a <em>Popular content</em> block that displays the day\'s most viewed content, the all-time most viewed content, and the last content viewed. (Enable the <em>Popular content</em> block on the <a href=\"@blocks\">blocks administration page</a>.)','none');
INSERT INTO `drupal_locales_source` VALUES (16480,' modules/statistics/statistics.module:23','default','Configuring the statistics module','none');
INSERT INTO `drupal_locales_source` VALUES (16481,' modules/statistics/statistics.module:24','default','When the <em>Enable access log</em> setting on the <a href=\"@accesslog\">access log settings page</a> is enabled, data about every page accessed (including the remote host\'s IP address, referrer, node accessed, and user name) is stored in the access log. The access log must be enabled for the <a href=\"@recent-hits\">recent hits</a>, <a href=\"@top-referrers\">top referrers</a>, <a href=\"@top-pages\">top pages</a>, and <a href=\"@top-visitors\">top visitors</a> log pages to function. Enabling the access log adds one additional database call per page displayed by Drupal.','none');
INSERT INTO `drupal_locales_source` VALUES (16482,' modules/statistics/statistics.module:25','default','The <em>Discard access logs older than</em> setting on the <a href=\"@accesslog\">access log settings page</a> specifies the length of time entries are retained in the access log before they are deleted. Automatic access log entry deletion requires a correctly configured <a href=\"@cron\">cron maintenance task</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (16483,' modules/statistics/statistics.module:26','default','The <em>Count content views</em> setting on the <a href=\"@accesslog\">access log settings page</a> enables a counter for each post on your site that increments each time the post is viewed. This option must be enabled to provide post-specific access counts. Enabling this option adds one additional database call per each post displayed by Drupal.','none');
INSERT INTO `drupal_locales_source` VALUES (16484,' modules/statistics/statistics.module:27','default','For more information, see the online handbook entry for <a href=\"@statistics\">Statistics module</a>.','none');
