INSERT INTO `drupal_locales_source` VALUES (16429,' modules/search/search.module:100','default','To provide keyword searching, the search engine maintains an index of words found in your site\'s content. To build and maintain this index, a correctly configured <a href=\"@cron\">cron maintenance task</a> is required. Indexing behavior can be adjusted using the <a href=\"@searchsettings\">search settings page</a>; for example, the <em>Number of items to index per cron run</em> sets the maximum number of items indexed in each pass of a <a href=\"@cron\">cron maintenance task</a>. If necessary, reduce this number to prevent timeouts and memory errors when indexing.','none');
