INSERT INTO `drupal_locales_source` VALUES (16245,' modules/path/path.module:29','default','Drupal provides complete control over URLs through aliasing, which is often used to make URLs more readable or easy to remember. For example, the alias \'about\' may be mapped onto the post at the system path \'node/1\', creating a more meaningful URL. Each system path can have multiple aliases.','none');
