INSERT INTO `drupal_locales_source` VALUES (16243,' modules/path/path.module:25','default','This module also provides user-defined mass URL aliasing capabilities, which is useful if you wish to uniformly use URLs different from the default. For example, you may want to have your URLs presented in a different language. Access to the Drupal source code on the web server is required to set up mass URL aliasing. ','none');
INSERT INTO `drupal_locales_source` VALUES (16242,' modules/path/path.module:24','default','The path module enables appropriately permissioned users to specify an optional alias in all node input and editing forms, and provides an interface to view and edit all URL aliases. The two permissions related to URL aliasing are <em>administer url aliases</em> and <em>create url aliases</em>. ','none');
INSERT INTO `drupal_locales_source` VALUES (16241,' modules/path/path.module:16','default','<p>Some examples of URL aliases are:</p>\n<ul>\n<li>user/login =&gt; login</li>\n<li>image/tid/16 =&gt; store</li>\n<li>taxonomy/term/7+19+20+21 =&gt; store/products/whirlygigs</li>\n<li>node/3 =&gt; contact</li>\n</ul>\n','none');
