INSERT INTO `drupal_locales_source` VALUES (16083,' modules/node/node.module:41','default','The administrative <a href=\"@content\">content page</a> allows you to review and manage your site content. The <a href=\"@post-settings\">post settings page</a> sets certain options for the display of posts. The node module makes a number of permissions available for each content type, which may be set by role on the <a href=\"@permissions\">permissions page</a>.','6.19');
INSERT INTO `drupal_locales_source` VALUES (16082,' modules/node/node.module:40','default','Though each post on your site is a node, each post is also of a particular <a href=\"@content-type\">content type</a>. <a href=\"@content-type\">Content types</a> are used to define the characteristics of a post, including the title and description of the fields displayed on its add and edit pages. Each content type may have different default settings for <em>Publishing options</em> and other workflow controls. By default, the two content types in a standard Drupal installation are <em>Page</em> and <em>Story</em>. Use the <a href=\"@content-type\">content types page</a> to add new or edit existing content types. Additional content types also become available as you enable additional core, contributed and custom modules.','6.19');
INSERT INTO `drupal_locales_source` VALUES (16081,' modules/node/node.module:39','default','The node module manages content on your site, and stores all posts (regardless of type) as a \"node\". In addition to basic publishing settings, including whether the post has been published, promoted to the site front page, or should remain present (or sticky) at the top of lists, the node module also records basic information about the author of a post. Optional revision control over edits is available. For additional functionality, the node module is often extended by other modules.','6.19');
