INSERT INTO `drupal_locales_source` VALUES (15957,' modules/menu/menu.info:0','default','Allows administrators to customize the site navigation menu.','6.16');
INSERT INTO `drupal_locales_source` VALUES (15958,' modules/menu/menu.module:21','default','The menu module provides an interface to control and customize Drupal\'s powerful menu system. Menus are a hierarchical collection of links, or menu items, used to navigate a website, and are positioned and displayed using Drupal\'s flexible block system. By default, three menus are created during installation: <em>Navigation</em>, <em>Primary links</em>, and <em>Secondary links</em>. The <em>Navigation</em> menu contains most links necessary for working with and navigating your site, and is often displayed in either the left or right sidebar. Most Drupal themes also provide support for <em>Primary links</em> and <em>Secondary links</em>, by displaying them in either the header or footer of each page. By default, <em>Primary links</em> and <em>Secondary links</em> contain no menu items but may be configured to contain custom menu items specific to your site.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15959,' modules/menu/menu.module:22','default','The <a href=\"@menu\">menus page</a> displays all menus currently available on your site. Select a menu from this list to add or edit a menu item, or to rearrange items within the menu. Create new menus using the <a href=\"@add-menu\">add menu page</a> (the block containing a new menu must also be enabled on the <a href=\"@blocks\">blocks administration page</a>).','6.19');
INSERT INTO `drupal_locales_source` VALUES (15960,' modules/menu/menu.module:23','default','For more information, see the online handbook entry for <a href=\"@menu\">Menu module</a>.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15961,' modules/menu/menu.module:26','default','Menus are a collection of links (menu items) used to navigate a website. The menus currently available on your site are displayed below. Select a menu from this list to manage its menu items.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15962,' modules/menu/menu.module:28','default','Enter the name for your new menu. Remember to enable the newly created block in the <a href=\"@blocks\">blocks administration page</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15963,' modules/menu/menu.module:30','default','To rearrange menu items, grab a drag-and-drop handle under the <em>Menu item</em> column and drag the items (or group of items) to a new location in the list. (Grab a handle by clicking and holding the mouse while hovering over a handle icon.) Remember that your changes will not be saved until you click the <em>Save configuration</em> button at the bottom of the page.','6.19');
