INSERT INTO `drupal_locales_source` VALUES (15880,' modules/locale/locale.module:44','default','<strong>Domain name only.</strong> The presentation language is determined by examining the domain used to access the site, and comparing it to the language domain (if any) specified for each language. If a match is not identified, the default language is used. <em>Example: \"http://de.example.com/contact\" sets presentation language to German based on the use of \"http://de.example.com\" in the domain.</em>','none');
INSERT INTO `drupal_locales_source` VALUES (15881,' modules/locale/locale.module:45','default','The path prefix or domain name for a language may be set by editing the <a href=\"@languages\">available languages</a>. In the absence of an appropriate match, the site is displayed in the <a href=\"@languages\">default language</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15882,' modules/locale/locale.module:48','default','This page provides an overview of available translatable strings. Drupal displays translatable strings in text groups; modules may define additional text groups containing other translatable strings. Because text groups provide a method of grouping related strings, they are often used to focus translation efforts on specific areas of the Drupal interface.','6.16');
INSERT INTO `drupal_locales_source` VALUES (15883,' modules/locale/locale.module:49','default','Review the <a href=\"@languages\">languages page</a> for more information on adding support for additional languages.','6.16');
INSERT INTO `drupal_locales_source` VALUES (15884,' modules/locale/locale.module:52','default','This page imports the translated strings contained in an individual Gettext Portable Object (<em>.po</em>) file. Normally distributed as part of a translation package (each translation package may contain several <em>.po</em> files), a <em>.po</em> file may need to be imported after off-line editing in a Gettext translation editor. Importing an individual <em>.po</em> file may be a lengthy process.','none');
INSERT INTO `drupal_locales_source` VALUES (15885,' modules/locale/locale.module:53','default','Note that the <em>.po</em> files within a translation package are imported automatically (if available) when new modules or themes are enabled, or as new languages are added. Since this page only allows the import of one <em>.po</em> file at a time, it may be simpler to download and extract a translation package into your Drupal installation directory and <a href=\"@language-add\">add the language</a> (which automatically imports all <em>.po</em> files within the package). Translation packages are available for download on the <a href=\"@translations\">Drupal translation page</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15886,' modules/locale/locale.module:56','default','This page exports the translated strings used by your site. An export file may be in Gettext Portable Object (<em>.po</em>) form, which includes both the original string and the translation (used to share translations with others), or in Gettext Portable Object Template (<em>.pot</em>) form, which includes the original strings only (used to create new translations with a Gettext translation editor).','none');
INSERT INTO `drupal_locales_source` VALUES (15887,' modules/locale/locale.module:58','default','This page allows a translator to search for specific translated and untranslated strings, and is used when creating or editing translations. (Note: For translation tasks involving many strings, it may be more convenient to <a href=\"@export\">export</a> strings for off-line editing in a desktop Gettext translation editor.) Searches may be limited to strings found within a specific text group or in a specific language.','6.16');
INSERT INTO `drupal_locales_source` VALUES (15888,' modules/locale/locale.module:61','default','This block is only shown if <a href=\"@languages\">at least two languages are enabled</a> and <a href=\"@configuration\">language negotiation</a> is set to something other than <em>None</em>.','none');
