INSERT INTO `drupal_locales_source` VALUES (15879,' modules/locale/locale.module:43','default','<strong>Path prefix with language fallback.</strong> The presentation language is determined by examining the path for a language code or other custom string that matches the path prefix (if any) specified for each language. If a suitable prefix is not identified, the display language is determined by the user\'s language preferences from the <em>My Account</em> page, or by the browser\'s language settings. If a presentation language cannot be determined, the default language is used.','none');
INSERT INTO `drupal_locales_source` VALUES (15867,' modules/locale/locale.module:26','default','Translations may be provided by:','none');
INSERT INTO `drupal_locales_source` VALUES (15868,' modules/locale/locale.module:27','default','translating the original text via the locale module\'s integrated web interface, or','none');
INSERT INTO `drupal_locales_source` VALUES (15869,' modules/locale/locale.module:28','default','importing files from a set of existing translations, known as a translation package. A translation package enables the display of a specific version of Drupal in a specific language, and contain files in the Gettext Portable Object (<em>.po</em>) format. Although not all languages are available for every version of Drupal, translation packages for many languages are available for download from the <a href=\"@translations\">Drupal translation page</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15870,' modules/locale/locale.module:29','default','If an existing translation package does not meet your needs, the Gettext Portable Object (<em>.po</em>) files within a package may be modified, or new <em>.po</em> files may be created, using a desktop Gettext editor. The locale module\'s <a href=\"@import\">import</a> feature allows the translated strings from a new or modified <em>.po</em> file to be added to your site. The locale module\'s <a href=\"@export\">export</a> feature generates files from your site\'s translated strings, that can either be shared with others or edited offline by a Gettext translation editor.','none');
INSERT INTO `drupal_locales_source` VALUES (15871,' modules/locale/locale.module:30','default','For more information, see the online handbook entry for <a href=\"@locale\">Locale module</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15872,' modules/locale/locale.module:33','default','This page provides an overview of your site\'s enabled languages. If multiple languages are available and enabled, the text on your site interface may be translated, registered users may select their preferred language on the <em>My account</em> page, and site authors may indicate a specific language when creating posts. The site\'s default language is used for anonymous visitors and for users who have not selected a preferred language.','none');
INSERT INTO `drupal_locales_source` VALUES (15873,' modules/locale/locale.module:34','default','For each language available on the site, use the <em>edit</em> link to configure language details, including name, an optional language-specific path or domain, and whether the language is natively presented either left-to-right or right-to-left. These languages also appear in the <em>Language</em> selection when creating a post of a content type with multilingual support.','none');
INSERT INTO `drupal_locales_source` VALUES (15874,' modules/locale/locale.module:35','default','Use the <a href=\"@add-language\">add language page</a> to enable additional languages (and automatically import files from a translation package, if available), the <a href=\"@search\">translate interface page</a> to locate strings for manual translation, or the <a href=\"@import\">import page</a> to add translations from individual <em>.po</em> files. A number of contributed translation packages containing <em>.po</em> files are available on the <a href=\"@translations\">Drupal.org translations page</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15875,' modules/locale/locale.module:38','default','Add all languages to be supported by your site. If your desired language is not available in the <em>Language name</em> drop-down, click <em>Custom language</em> and provide a language code and other details manually. When providing a language code manually, be sure to enter a standardized language code, since this code may be used by browsers to determine an appropriate display language.','none');
INSERT INTO `drupal_locales_source` VALUES (15876,' modules/locale/locale.module:40','default','Language negotiation settings determine the site\'s presentation language. Available options include:','none');
INSERT INTO `drupal_locales_source` VALUES (15877,' modules/locale/locale.module:41','default','<strong>None.</strong> The default language is used for site presentation, though users may (optionally) select a preferred language on the <em>My Account</em> page. (User language preferences will be used for site e-mails, if available.)','none');
INSERT INTO `drupal_locales_source` VALUES (15878,' modules/locale/locale.module:42','default','<strong>Path prefix only.</strong> The presentation language is determined by examining the path for a language code or other custom string that matches the path prefix (if any) specified for each language. If a suitable prefix is not identified, the default language is used. <em>Example: \"example.com/de/contact\" sets presentation language to German based on the use of \"de\" within the path.</em>','none');
INSERT INTO `drupal_locales_source` VALUES (15866,' modules/locale/locale.module:25','default','Beyond translation of the Drupal interface, the locale module provides a feature set tailored to the needs of a multi-lingual site. Language negotiation allows your site to automatically change language based on the domain or path used for each request. Users may (optionally) select their preferred language on their <em>My account</em> page, and your site can be configured to honor a web browser\'s preferred language settings. Your site content can be created in (and translated to) any enabled language, and each post may have a language-appropriate alias for each of its translations. The locale module works in concert with the <a href=\"@content-help\">content translation module</a> to manage translated content.','none');
