INSERT INTO `drupal_locales_source` VALUES (15781,' modules/forum/forum.module:31','default','These settings allow you to adjust the display of your forum topics. The content types available for use within a forum may be selected by editing the <em>Content types</em> on the <a href=\"@forum-vocabulary\">forum vocabulary page</a>.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15780,' modules/forum/forum.module:29','default','A forum holds related or similar forum topics (a forum topic is the initial post to a threaded discussion). For example, a forum named \"Fruit\" may contain forum topics titled \"Apples\" and \"Bananas\", respectively.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15779,' modules/forum/forum.module:27','default','By grouping related or similar forums, containers help organize forums. For example, a container named \"Food\" may hold two forums named \"Fruit\" and \"Vegetables\", respectively.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15778,' modules/forum/forum.module:25','default','This page displays a list of existing forums and containers. Containers (optionally) hold forums, and forums hold forum topics (a forum topic is the initial post to a threaded discussion). To provide structure, both containers and forums may be placed inside other containers and forums. To rearrange forums and containers, grab a drag-and-drop handle under the <em>Name</em> column and drag the forum or container to a new location in the list. (Grab a handle by clicking and holding the mouse while hovering over a handle icon.) Remember that your changes will not be saved until you click the <em>Save</em> button at the bottom of the page.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15777,' modules/forum/forum.module:22','default','For more information, see the online handbook entry for <a href=\"@forum\">Forum module</a>.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15775,' modules/forum/forum.module:20','default','selecting <em>Read only</em> under <em>Comment settings</em> while editing a forum topic will lock (prevent new comments) on the thread.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15776,' modules/forum/forum.module:21','default','selecting <em>Disabled</em> under <em>Comment settings</em> while editing a forum topic will hide all existing comments on the thread, and prevent new ones.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15774,' modules/forum/forum.module:19','default','when moving a forum topic between forums, the <em>Leave shadow copy</em> option creates a link in the original forum pointing to the new location.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15773,' modules/forum/forum.module:18','default','a forum topic (and all of its comments) may be moved between forums by selecting a different forum while editing a forum topic.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15772,' modules/forum/forum.module:17','default','When administering a forum, note that:','6.19');
INSERT INTO `drupal_locales_source` VALUES (15771,' modules/forum/forum.module:16','default','A threaded discussion occurs as people leave comments on a forum topic (or on other comments within that topic). A forum topic is contained within a forum, which may hold many similar or related forum topics. Forums are (optionally) nested within a container, which may hold many similar or related forums. Both containers and forums may be nested within other containers and forums, and provide structure for your message board. By carefully planning this structure, you make it easier for users to find and comment on a specific forum topic.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15770,' modules/forum/forum.module:15','default','The forum module lets you create threaded discussion forums with functionality similar to other message board systems. Forums are useful because they allow community members to discuss topics with one another while ensuring those conversations are archived for later reference. The <a href=\"@create-topic\">forum topic</a> menu item (under <em>Create content</em> on the Navigation menu) creates the initial post of a new threaded discussion, or thread.','6.19');
