INSERT INTO `drupal_locales_source` VALUES (15651,' modules/filter/filter.module:187','default','\n<p>This site allows HTML content. While learning all of HTML may feel intimidating, learning how to use a very small number of the most basic HTML \"tags\" is very easy. This table provides examples for each tag that is enabled on this site.</p>\n<p>For more information see W3C\'s <a href=\"http://www.w3.org/TR/html/\">HTML Specifications</a> or use your favorite search engine to find other sites that explain HTML.</p>','6.16');
INSERT INTO `drupal_locales_source` VALUES (15645,' modules/filter/filter.module:38','default','Filters are executed from top-to-bottom. To change the order of the filters, modify the values in the <em>Weight</em> column or grab a drag-and-drop handle under the <em>Name</em> column and drag filters to new locations in the list. (Grab a handle by clicking and holding the mouse while hovering over a handle icon.) Remember that your changes will not be saved until you click the <em>Save configuration</em> button at the bottom of the page.','none');
INSERT INTO `drupal_locales_source` VALUES (15641,' modules/filter/filter.module:30','default','Use the list below to configure which input formats are available to which roles, as well as choose a default input format (used for imported content, for example). The default format is always available to users. All input formats are available to users in a role with the \"administer filters\" permission.','none');
INSERT INTO `drupal_locales_source` VALUES (15642,' modules/filter/filter.module:33','default','Every <em>filter</em> performs one particular change on the user input, for example stripping out malicious HTML or making URLs clickable. Choose which filters you want to apply to text in this input format. If you notice some filters are causing conflicts in the output, you can <a href=\"@rearrange\">rearrange them</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15643,' modules/filter/filter.module:35','default','If you cannot find the settings for a certain filter, make sure you have enabled it on the <a href=\"@url\">view tab</a> first.','none');
INSERT INTO `drupal_locales_source` VALUES (15644,' modules/filter/filter.module:37','default','Because of the flexible filtering system, you might encounter a situation where one filter prevents another from doing its job. For example: a word in an URL gets converted into a glossary term, before the URL can be converted to a clickable link. When this happens, rearrange the order of the filters.','none');
INSERT INTO `drupal_locales_source` VALUES (15638,' modules/filter/filter.module:25','default','Users can choose between the available input formats when creating or editing content. Administrators can configure which input formats are available to which user roles, as well as choose a default input format.','none');
INSERT INTO `drupal_locales_source` VALUES (15639,' modules/filter/filter.module:26','default','For more information, see the online handbook entry for <a href=\"@filter\">Filter module</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15640,' modules/filter/filter.module:29','default','<em>Input formats</em> define a way of processing user-supplied text in Drupal. Each input format uses filters to manipulate text, and most input formats apply several different filters to text, in a specific order. Each filter is designed to accomplish a specific purpose, and generally either removes elements from or adds elements to text before it is displayed. Users can choose between the available input formats when submitting content.','none');
INSERT INTO `drupal_locales_source` VALUES (18331,'','default','Poland','6.19');
INSERT INTO `drupal_locales_source` VALUES (18727,'','default','Strip HTML tags','6.19');
INSERT INTO `drupal_locales_source` VALUES (15635,' modules/filter/filter.info:0','default','Handles the filtering of content in preparation for display.','6.16');
INSERT INTO `drupal_locales_source` VALUES (15636,' modules/filter/filter.module:23','default','The filter module allows administrators to configure text input formats for use on your site. An input format defines the HTML tags, codes, and other input allowed in both content and comments, and is a key feature in guarding against potentially damaging input from malicious users. Two input formats included by default are <em>Filtered HTML</em> (which allows only an administrator-approved subset of HTML tags) and <em>Full HTML</em> (which allows the full set of HTML tags). Additional input formats may be created by an administrator.','none');
INSERT INTO `drupal_locales_source` VALUES (15637,' modules/filter/filter.module:24','default','Each input format uses filters to manipulate text, and most input formats apply several different filters to text in a specific order. Each filter is designed for a specific purpose, and generally either adds, removes or transforms elements within user-entered text before it is displayed. A filter does not change the actual content of a post, but instead, modifies it temporarily before it is displayed. A filter may remove unapproved HTML tags, for instance, while another automatically adds HTML to make links referenced in text clickable.','none');
