INSERT INTO `drupal_locales_source` VALUES (15565,' modules/contact/contact.module:151','default','Allow other users to contact you by e-mail via <a href=\"@url\">your personal contact form</a>. Note that while your e-mail address is not made public to other members of the community, privileged users such as site administrators are able to contact you even if you choose not to enable this feature.','none');
INSERT INTO `drupal_locales_source` VALUES (15555,' modules/contact/contact.module:25','default','The menu item can be customized and configured only once the menu module has been <a href=\"@modules-page\">enabled</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15556,' modules/contact/contact.module:30','default','The contact module also adds a <a href=\"@menu-settings\">menu item</a> (disabled by default) to the navigation block.','none');
INSERT INTO `drupal_locales_source` VALUES (15553,' modules/contact/contact.module:20','default','For more information, see the online handbook entry for <a href=\"@contact\">Contact module</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15554,' modules/contact/contact.module:23','default','This page lets you set up <a href=\"@form\">your site-wide contact form</a>. To do so, add one or more categories. You can associate different recipients with each category to route e-mails to different people. For example, you can route website feedback to the webmaster and direct product information requests to the sales department. On the <a href=\"@settings\">settings page</a>, you can customize the information shown above the contact form. This can be useful to provide additional contact information such as your postal address and telephone number.','none');
INSERT INTO `drupal_locales_source` VALUES (15551,' modules/contact/contact.module:18','default','A link to your site\'s <a href=\"@contact\">contact page</a> from the main <em>Navigation</em> menu is created, but is disabled by default. Create a similar link on another menu by adding a menu item pointing to the path \"contact\"','none');
INSERT INTO `drupal_locales_source` VALUES (15552,' modules/contact/contact.module:19','default','Customize the <a href=\"@contact\">contact page</a> with additional information (like physical location, mailing address, and telephone number) using the <a href=\"@contact-settings\">contact form settings page</a>. The <a href=\"@contact-settings\">settings page</a> also provides configuration options for the maximum number of contact form submissions a user may perform per hour, and the default status of users\' personal contact forms.','none');
INSERT INTO `drupal_locales_source` VALUES (15550,' modules/contact/contact.module:17','default','The <a href=\"@contact\">contact page</a> provides a simple form for visitors to leave comments, feedback, or other requests. Messages are routed by selecting a category from a list of administrator-defined options; each category has its own set of e-mail recipients. Common categories for a business site include, for example, \"Website feedback\" (messages are forwarded to web site administrators) and \"Product information\" (messages are forwarded to members of the sales department). The actual e-mail addresses defined within a category are not displayed. Only users in roles with the <em>access site-wide contact form</em> permission may access the <a href=\"@contact\">contact page</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15548,' modules/contact/contact.module:15','default','The contact module facilitates communication via e-mail, by allowing your site\'s visitors to contact one another (personal contact forms), and by providing a simple way to direct messages to a set of administrator-defined recipients (the <a href=\"@contact\">contact page</a>). With either form, users specify a subject, write their message, and (optionally) have a copy of their message sent to their own e-mail address.','none');
INSERT INTO `drupal_locales_source` VALUES (15549,' modules/contact/contact.module:16','default','Personal contact forms allow users to be contacted via e-mail, while keeping recipient e-mail addresses private. Users may enable or disable their personal contact forms by editing their <em>My account</em> page. If enabled, a <em>Contact</em> tab leading to their personal contact form is available on their user profile. Site administrators have access to all personal contact forms (even if they have been disabled). The <em>Contact</em> tab is only visible when viewing another user\'s profile (users do not see their own <em>Contact</em> tab).','none');
