INSERT INTO `drupal_locales_source` VALUES (15414,' modules/comment/comment.module:129','default','The comment module allows visitors to comment on your posts, creating ad hoc discussion boards. Any <a href=\"@content-type\">content type</a> may have its <em>Default comment setting</em> set to <em>Read/Write</em> to allow comments, or <em>Disabled</em>, to prevent comments. Comment display settings and other controls may also be customized for each content type (some display settings are customizable by individual users).','none');
INSERT INTO `drupal_locales_source` VALUES (15415,' modules/comment/comment.module:130','default','Comment permissions are assigned to user roles, and are used to determine whether anonymous users (or other roles) are allowed to comment on posts. If anonymous users are allowed to comment, their individual contact information may be retained in cookies stored on their local computer for use in later comment submissions. When a comment has no replies, it may be (optionally) edited by its author. The comment module uses the same input formats and HTML tags available when creating other forms of content.','none');
