INSERT INTO `drupal_locales_source` VALUES (15382,' modules/color/color.module:11','default','It is important to remember that color module saves a modified copy of the theme\'s specified stylesheets in the files directory. This means that if you make any manual changes to your theme\'s stylesheet, you must save your color settings again, even if they haven\'t changed. This causes the color module generated version of the stylesheets in the files directory to be recreated using the new version of the original file.','none');
INSERT INTO `drupal_locales_source` VALUES (15381,' modules/color/color.module:10','default','The color module allows a site administrator to quickly and easily change the color scheme of certain themes. Although not all themes support color module, both Garland (the default theme) and Minnelli were designed to take advantage of its features. By using color module with a compatible theme, you can easily change the color of links, backgrounds, text, and other theme elements. Color module requires that your <a href=\"@url\">file download method</a> be set to public.','none');
