INSERT INTO `drupal_locales_source` VALUES (15359,' modules/book/book.module:1014','default','The book module offers a means to organize a collection of related posts, collectively known as a book. When viewed, these posts automatically display links to adjacent book pages, providing a simple navigation system for creating and reviewing structured content.','none');
