INSERT INTO `drupal_locales_source` VALUES (15356,' modules/book/book.module:1009','default','Users with the <em>administer book outlines</em> permission can add a post of any content type to a book, by selecting the appropriate book while editing the post or by using the interface available on the post\'s <em>outline</em> tab.','none');
INSERT INTO `drupal_locales_source` VALUES (15357,' modules/book/book.module:1010','default','Administrators can view a list of all books on the <a href=\"@admin-node-book\">book administration page</a>. The <em>Outline</em> page for each book allows section titles to be edited or rearranged.','none');
INSERT INTO `drupal_locales_source` VALUES (15354,' modules/book/book.module:1007','default','Pages in the book hierarchy have navigation elements at the bottom of the page for moving through the text. These links lead to the previous and next pages in the book, and to the level above the current page in the book\'s structure. More comprehensive navigation may be provided by enabling the <em>book navigation block</em> on the <a href=\"@admin-block\">blocks administration page</a>.','none');
