INSERT INTO `drupal_locales_source` VALUES (15250,' modules/blogapi/blogapi.module:16','default','<a href=\"@ecto-link\">Ecto</a>, a blogging client available for both Mac OS X and Microsoft Windows, can be used with Blog API. Blog API also supports <a href=\"@blogger-api\">Blogger API</a>, <a href=\"@metaweblog-api\">MetaWeblog API</a>, and most of the <a href=\"@movabletype-api\">Movable Type API</a>. Blogging clients and other services (e.g. <a href=\"@flickr\">Flickr\'s</a> \"post to blog\") that support these APIs may also be compatible.','none');
