INSERT INTO `drupal_locales_source` VALUES (15229,' modules/blog/blog.module:68','default','When using the aggregator module an automatic <em>blog it</em> icon is displayed next to the items in a feed\'s <em>latest items</em> block. Clicking this icon populates a <em>blog entry</em> with a title (the title of the feed item) and body (a link to the source item on its original site and illustrative content suitable for use in a block quote). Blog authors can use this feature to easily comment on items of interest that appear in aggregator feeds from other sites. To use this feature, be sure to <a href=\"@modules\">enable</a> the aggregator module, <a href=\"@feeds\">add and configure</a> a feed from another site, and <a href=\"@blocks\">position</a> the feed\'s <em>latest items</em> block.','none');
INSERT INTO `drupal_locales_source` VALUES (15227,' modules/blog/blog.module:66','default','There is an (optional) <em>Blogs</em> menu item added to the Navigation menu, which displays all blogs available on your site, and a <em>My blog</em> item displaying the current user\'s blog entries. The <em>Blog entry</em> menu item under <em>Create content</em> allows new blog entries to be created.','none');
INSERT INTO `drupal_locales_source` VALUES (15228,' modules/blog/blog.module:67','default','Each blog entry is displayed with an automatic link to other blogs created by the same user. By default, blog entries have comments enabled and are automatically promoted to the site front page. The blog module also creates a <em>Recent blog posts</em> block that may be enabled at the <a href=\"@blocks\">blocks administration page</a>.','none');
