INSERT INTO `drupal_locales_source` VALUES (15187,' modules/block/block.module:71','default','Although blocks are usually generated automatically by modules (like the <em>User login</em> block, for example), administrators can also define custom blocks. Custom blocks have a title, description, and body. The body of the block can be as long as necessary, and can contain content supported by any available <a href=\"@input-format\">input format</a>.','6.19');
INSERT INTO `drupal_locales_source` VALUES (15186,' modules/block/block.module:70','default','Blocks are boxes of content rendered into an area, or region, of a web page. The default theme Garland, for example, implements the regions \"left sidebar\", \"right sidebar\", \"content\", \"header\", and \"footer\", and a block may appear in any one of these areas. The <a href=\"@blocks\">blocks administration page</a> provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions.','6.19');
