INSERT INTO `drupal_locales_source` VALUES (15110,' modules/aggregator/aggregator.module:26','default','Categories allow feed items from different feeds to be grouped together. For example, several sport-related feeds may belong to a category named <em>Sports</em>. Feed items may be grouped automatically (by selecting a category when creating or editing a feed) or manually (via the <em>Categorize</em> page available from feed item listings). Each category provides its own feed page and block.','none');
INSERT INTO `drupal_locales_source` VALUES (15109,' modules/aggregator/aggregator.module:24','default','Add a feed in RSS, RDF or Atom format. A feed may only have one entry.','none');
INSERT INTO `drupal_locales_source` VALUES (15108,' modules/aggregator/aggregator.module:21','default','Current feeds are listed below, and <a href=\"@addfeed\">new feeds may be added</a>. For each feed or feed category, the <em>latest items</em> block may be enabled at the <a href=\"@block\">blocks administration page</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15107,' modules/aggregator/aggregator.module:20','default','Thousands of sites (particularly news sites and blogs) publish their latest headlines and posts in feeds, using a number of standardized XML-based formats. Formats supported by the aggregator include <a href=\"@rss\">RSS</a>, <a href=\"@rdf\">RDF</a>, and <a href=\"@atom\">Atom</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15106,' modules/aggregator/aggregator.module:17','default','For more information, see the online handbook entry for <a href=\"@aggregator\">Aggregator module</a>.','none');
INSERT INTO `drupal_locales_source` VALUES (15105,' modules/aggregator/aggregator.module:16','default','Feeds contain feed items, or individual posts published by the site providing the feed. Feeds may be grouped in categories, generally by topic. Users view feed items in the <a href=\"@aggregator\">main aggregator display</a> or by <a href=\"@aggregator-sources\">their source</a>. Administrators can <a href=\"@feededit\">add, edit and delete feeds</a> and choose how often to check each feed for newly updated items. The most recent items in either a feed or category can be displayed as a block through the <a href=\"@admin-block\">blocks administration page</a>. A <a href=\"@aggregator-opml\">machine-readable OPML file</a> of all feeds is available. A correctly configured <a href=\"@cron\">cron maintenance task</a> is required to update feeds automatically.','none');
INSERT INTO `drupal_locales_source` VALUES (15104,' modules/aggregator/aggregator.module:15','default','The aggregator is a powerful on-site syndicator and news reader that gathers fresh content from RSS-, RDF-, and Atom-based feeds made available across the web. Thousands of sites (particularly news sites and blogs) publish their latest headlines and posts in feeds, using a number of standardized XML-based formats. Formats supported by the aggregator include <a href=\"@rss\">RSS</a>, <a href=\"@rdf\">RDF</a>, and <a href=\"@atom\">Atom</a>.','none');
